import './Nav.css';

import { Link } from 'react-router-dom';






function Nav() {
    return(

        <>
        <div  className='nav-item my-3 w-28 '>
            <nav className="flex justify-center space-x-4">
                <Link to="#">Home</Link>
               
            </nav>

            
        </div>
        


        
        </>
    );
}
